import { useContext, useEffect, useState } from "react";

import MyHeader from './../components/LoginHeader'
import LoginInputBox from './../components/LoginInputBox'
import LoginButton from './../components/LoginButton'

const MyPage = () => {
    return (
        <div>
            <MyHeader
                headText={"내 정보"}
                leftChild={
                <MyButton text={"< 뒤로가기"} onClick={() => navigate(-1)} />
                }
                rightChild={isEdit ?
                <MyButton
                text={"수정완료"}
                type={"neutral"}
                onClick={handleSubmit}
                /> :
                <MyButton
                text={"작성완료"}
                type={"positive"}
                onClick={handleSubmit}
                />
                }
            />
            <div className="login_wrap">
                <div className="login_box">
                    <LoginInputBox 
                        title={"아이디"}
                        input={""}/>
                    <LoginInputBox 
                        title={"현재 비밀번호"}
                        input={""}
                        type={"password"} />
                    <LoginInputBox 
                        title={"새로운 비밀번호"}
                        input={""}
                        type={"password"} />
                    <LoginInputBox 
                        title={"비밀번호 재확인"}
                        input={""}
                        type={"password"} />
                    <LoginInputBox
                        title={"이름"}
                        input={""} />
                    <LoginInputBox
                        title={"전화번호"}
                        input={""} />
                    <LoginButton text={"내 정보 변경"} />
                </div>
            </div>
        </div>
    );
};

export default MyPage;
